import React from "react";
import reactDom from "react-dom";
let firstName = 'Akalesh ';
let lastName = ' Tanwer';
reactDom.render(
  [
    <h1>`My first name  is ${firstName} and my last name is ${lastName}`}</h1>,
    <h1>Top {2+3} Programming languages in 2021</h1>,
    <p>Languages are :-</p>,
    <ol>
      <li>Javascript </li>
      <li>Phython</li>
      <li>C/C++</li>
      <li>Java</li>
      <li>R Lanuages</li>
    </ol>
  ],
  document.getElementById('root')
)
